    graph = {}
    for edge in tree.split("\n"):
        v1, v2 = [int(x) for x in edge.split()]
        if v1 in graph:
            graph[v1].append(v2)
        else:
            graph[v1] = [v2]
        if v2 in graph:
            graph[v2].append(v1)
        else:
            graph[v2] = [v1]
    answer = 0
    for i in range(n):
        if i in graph:
            for j in range(n):
                if j in graph:
                    path = [i]
                    visited = {i}
                    while len(path) > 1:
                        for a in graph[path[-1]]:
                            if a in visited:
                                path = path[:path.index(a) + 1]
                                visited = visited | {a}
                                break
                        if a not in visited:
                            break
                    answer = max(answer, len(path) - 1)
    return str(answer)

