def solution(stdin: str) -> str:
    """
    Finds the number of ways to climb up the stairs, under the condition,
    that there are no broken steps.

    This is a brute force solution, but it is simple and fast.
    """
    n, m = list(map(int, stdin.split(" ")))
    broken = list(map(int, stdin.split(" ")))
    ways = [1]
    for i in range(1, n):
        tmp = [0] * (n + 1)
        for j in range(0, i + 1):
            if j > 0 and j - 1 not in broken:
                tmp[j] = (tmp[j] + ways[j - 1]) % 1000000007
            if j > 1 and j - 2 not in broken:
                tmp[j] = (tmp[j] + ways[j - 2]) % 1000000007
        ways = tmp
    return str(ways[-1])


