def solution(stdin: str) -> str:
    n, k, x = [int(x) for x in stdin.split()]
    a = [int(x) for x in stdin.split()]
    a.sort()
    if n < k:
        return -1

    def add(a: int, b: int, k: int, l: int) -> int:
        if k == 0:
            return b
        if a > b:
            a, b = b, a
        if k == l:
            return max(b, b + (a - b) % a)
        if l > k:
            return b
        return b + (a - b) % a

    def make(a: int, b: int, k: int, l: int) -> int:
        if k == 0:
            return 0
        if a > b:
            a, b = b, a
        if k == l:
            return a
        return a + (b - a) % a

    res = 0
    for i in range(n - k + 1):
