    i = 0
    while i < len(a):
        stack.append(a[i])
        while i < len(a) - 1 and possible(a, i):
            stack.append(a[i + 1])
            i += 1
        if len(stack) > h * n:
            return "NO"
        i += 1
    return "YES"

