            if H[i] > cur_max:
                cur_max = H[i]
        # for the first element
        if k == 0:
            H[k] = cur_max
            continue

        # find the current maximum
        cur_max = -1
        for i in range(k, r):
            if H[i] > cur_max:
                cur_max = H[i]
        # for the last element
        if r == N:
            H[r] = cur_max
    # check if all elements are equal
    for i in range(N):
        if H[i]!= 0:
            return -1
    return str(r - k)

