    n = int(stdin.readline())
    times = [int(stdin.readline()) for _ in range(n)]

    clock_pointer = [1] * n
    hand = [1] * n

    # Bubble sort the hand of each clock
    for _ in range(n):
        for j in range(n - 1):
            if hand[j] > hand[j + 1]:
                hand[j], hand[j + 1] = hand[j + 1], hand[j]
                clock_pointer[j], clock_pointer[j + 1] = clock_pointer[j + 1], clock_pointer[j]

    # Get the index of the maximum hand
    max_hand_index = 0
    for i in range(n):
        if hand[i] > hand[max_hand_index]:
            max_hand_index = i

    # Get the clock time
    time_required = 0
    for i in range(max_hand_index, -1, -1):
        time_required += clock_pointer[i] * times[i]

    return str(time_required)

